import React from 'react';
import Carousel from 'react-images';


const images = [{ src: "https://unsplash.com/photos/8MMtYM_3xMY", 
                  src: 'https://www.example.com/foo.jpg' }];

class Activty extends React.Component {
  constructor(props) {
    super(props)

    console.log(props);
  }

  render() { 
    return (
        <Carousel views={props.images} />
    );
  }
}

export default Activty;
